import React from 'react';
import './App.css';
import ZibbyBlob from './ZibbyBlob';
import IconButton from './IconButton';
import { FaUser, FaComments, FaBook, FaUsers, FaRegCalendarAlt } from 'react-icons/fa'; // Import icons

function App() {
  return (
    <div className="app-container">
      <h1>Zibby</h1>
      <div className="zibby-ui">
        <IconButton label="Me" icon={<FaUser />} notification />
        <IconButton label="ZibLine" icon={<FaComments />} />
        <IconButton label="Memories" icon={<FaBook />} badgeCount={3} />
        <ZibbyBlob />
        <IconButton label="Family & Friends" icon={<FaUsers />} badgeCount={2} />
        <IconButton label="Journal" icon={<FaRegCalendarAlt />} />
      </div>
    </div>
  );
}

export default App;
